import Header from "./components/Header";
import Home from "./components/Home";


import "./styles/App.scss";
import "./styles/header.scss";


function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />}/>
      </Routes>
    </Router>

  );
}

export default App;
